    //a classic sliding windows problem
    public static int lengthOfLongestSubstring(String s) {
        if (s == null || s.length() == 0)
            return 0;
        int[] alphabet = new int[128];
        int maxLen = 1;
        int slow = 0;
//        int start = 0;
//        int end = 1;
        //Attention: the starting point of char is ' ' or '!'
        for (int i = 0; i < s.length(); i++) {
            char curr = s.charAt(i);
            if (alphabet[curr - ' '] <= 0) {
                alphabet[curr - ' ']++;
                //add visited tag
            } else {
                //when find dup, aka curr==somewhere previous, we need to make the string valid again, by removing the dup from substring
                //ex cdakmla when we found a, we need move the slow pointer from c to k
                if (maxLen < i - slow) {
                    maxLen = Math.max(maxLen, i - slow);
//                    start = slow;
//                    end = i;
                }
                while (s.charAt(i) != s.charAt(slow)) {
                    alphabet[s.charAt(slow) - ' ']--;
                    slow++;
                }
                slow++;
            }
        }

        //Attention: do not forget to add this to the last, as maybe the whole input has not dup
        if (maxLen < s.length() - slow) {
            maxLen = Math.max(maxLen, s.length() - slow);
//            start = slow;
//            end =s.length();
        }

        // System.out.println(s.substring(start, end));
        return maxLen;

    }
